description:
Category	All Girl, Girl-Girl, Feature, Plot Based, Lesbian, Parody / Spoof

Director	Lily Cade
Starring	Nina Hartley, Aiden Starr, Aaliyah Love, Zoey Monroe, Vanessa Veracruz, Ela Darling, Lily Cade, Lotus Lain

This Election season, politics get dirty when Staffer Elena (Vanessa Veracruz) witnesses Hillary (Nina Hartley) and Michelle`s (Lotus Lain) secret tryst. Will she tell the media (Aaliyah Love as Megyn K and Lily Cade as Rachel M) or will Fixer Aiden Starr make her an offer she can`t refuse? Find out in this raunchy Capital Hill farce.

